import { Link } from "react-router-dom";
import ilusha from "../Components/ilusha.jpg";
import "./MainPage.css";
import "../Components/Modal_okno/Modal_okno";
import Window from "../Components/Modal_okno/Window";
import Gallery from "../Drist/App1";
import { Makson } from "../Components/Pages";

export const MainPage = () => (
  <nav>
    <div className="app-wrapper">
      <header className="header">
        <img src={ilusha} />
      </header>
      <nav className="nav">
        <div>
          <Link to="/pasko">Настройки профиля</Link>
        </div>
        <div>
          <Link to="/two">Счета</Link>{" "}
        </div>

        <div>
          <Window />
        </div>
      </nav>
      <div className="content">
        <Gallery />
      </div>
      <div className="back">
        <Makson />
      </div>
    </div>
  </nav>
);

export default MainPage;
